import React from 'react';
import {Card} from 'react-bootstrap';
import { connect } from 'react-redux';
import Task from '../Task/task';
import { setDoingTasks } from '../../actions/tasks';

class DeletedList extends React.PureComponent
{
   render()
   {
       return(
        <Card className="DoingList_card">
        <Card.Body>
            <Card.Text> Deleted </Card.Text>
            {
          this.props.doingTasks.filter(t => !(t.completed).map(t => (<Task key={t.id} {...t} ></Task>)))
          }
        </Card.Body>
        </Card>
       )
   }
}
const mapStateToProps = state => ({
    doingTasks: state.doingTasks,
  });
  
  
  const mapDispatchToProps = dispatch => ({
    setData: doingTasks => dispatch(setDoingTasks(doingTasks)),
  });
  
  
  export default connect(mapStateToProps, mapDispatchToProps)(DeletedList);
